        try:
            # Use a stack to simulate the parse tree
            stack = []
            for token in grammar:
                if token.isalpha():
                    stack.append(token)
                elif token == " ":
                    continue
                else:
                    # Treat as a symbol
                    stack.append(token)

            #Check if the input string is in the grammar
            if stack and input_string in stack:
