def solve():
    s = "t1 t8 t12 t6 t0 t7 t0 t3 t7 t5 t12 t1 t11 t14 t15 t8 t12 t6 t2"

    def check_grammar(grammar, string):
        stack = []
        for char in string:
            if char in grammar.keys():
                stack.append(char)
            elif char in grammar.values():
                if not stack:
                    return False
                top = stack.pop()
                if grammar[top] != string:
                    return False
        return not stack

    if check_grammar(s, s):
        print("Yes")
    else:
        print("No")

solve()
